    function isChild(string memory str) public pure returns (bool){
        string memory root = "ftypmoovudatatrakmdiatrefminfdinfstbl";
        for(uint j = 0; j < bytes(root).length; j += 4){
            if(keccak256(bytes(str)) == keccak256(bytes(root.substring(j, j + 4))))
                return true;
        }
        return false;
    }
    
}
